Step inside your dream home on the Eastern Shore of Maryland 🏡 [sponsored]

@lakeside_at_trappe offers the option to build a personalized new home or lease! Both offer floor plans with main-level living and access to resort style amenities throughout the community {soon to come in 2024!}

We had the opportunity to attend their fall festival where the kids were able to participate in a scavenger hunt throughout the models and decorate pumpkins.

This community is in an ideal location. Right down the road is the town of Easton, MD which offers lots of shopping and restaurant options. Nearby eastern shore beaches like Rehoboth and Bethany are only a short drive away. We love being close to the beach so we can squeeze in day trips with the kids.

Check out my stories for a more in-depth tour of the Beckham, Douglas, and Ashton models.

What’s your must have in a new home? Mine is a large pantry for sure. 

